import React from "react";
import SideBarDD from "../SideBarD";
import AddData from "./AddData";
import WelcomeBarD from "../WelcomeBar";
import {
  SideBarContainer,
  ContentContainer,
  DashboardContainer,
} from "./DataElements";
import { AiFillHome } from "react-icons/ai";

const DashData = () => {
  const tellPath = () => {
    return (
      <>
        <AiFillHome style={{ "margin-right": "5px" }}></AiFillHome>
        /Datasets
      </>
    );
  };

  const checkD = () => {
    if (true) {
      return (
        <>
          <AddData></AddData>
        </>
      );
    } else {
      return (
        <>
          <AddData></AddData>
        </>
      );
    }
  };

  return (
    <>
      <DashboardContainer>
        <SideBarContainer>
          <SideBarDD></SideBarDD>
        </SideBarContainer>
        <ContentContainer>
          <WelcomeBarD path={tellPath()}></WelcomeBarD>
          {checkD}
        </ContentContainer>
      </DashboardContainer>
    </>
  );
};

export default DashData;
